-- ----------------------------
-- Table structure for consult_region
-- ----------------------------
DROP TABLE IF EXISTS `consult_region`;
CREATE TABLE `consult_region`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '地区的唯一标识符',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '地区的中文名称',
  `name_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '地区的英文名称',
  `country_id` bigint NULL DEFAULT NULL COMMENT '所属国家ID',
  `country_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '所属国家名称',
  `province_id` bigint NULL DEFAULT NULL COMMENT '所属省份ID',
  `province_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '所属省份名称',
  `level` tinyint(1) NULL DEFAULT NULL COMMENT '行政等级（1为国家、2为省份、3为城市）',
  `created_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '创建人',
  `created_at` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `longitude` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '经度',
  `latitude` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '纬度',
  `is_hot` tinyint NULL DEFAULT 0 COMMENT '是否为常亮城市（0为否，1为是）',
  `is_deleted` tinyint NULL DEFAULT 0 COMMENT '是否删除（0为否，1为是）',
  `update_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '修改人',
  `update_at` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_special` tinyint NULL DEFAULT 0 COMMENT '是否为特殊城市标点',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 627 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '地区信息表' ROW_FORMAT = DYNAMIC;

